import React, { Component } from 'react';

class Signin extends Component {

    constructor() {
        this.setState()
    }

    SigninForm = (name, email, password) => (
        <form>
            <div className="form-group">
                <label for="exampleInputEmail1">Email address</label>
                <input type="email" onChange={name} className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="Enter email" autoComplete="off" />
            </div>
            <div className="form-group">
                <label for="exampleInputPassword1">Password</label>
                <input type="password" onChange={email} className="form-control" id="exampleInputPassword1" placeholder="Password" autoComplete="off" />
            </div>
            <div className="form-check">
                <input type="checkbox" onChange={password} className="form-check-input" id="exampleCheck1" />
                <label className="form-check-label" for="exampleCheck1">Check me out</label>
            </div>
            <button type="submit" className="btn bg-success">Submit</button>
        </form>
    )

    render() {
        return (
            <div className="">
                <div className="jumbotron">
                    <h1>SignIn</h1>
                </div>
                <div className="container">
                    { this.SigninForm() }
                </div>
            </div>
        );
    }
}

export default Signin;
